                    new ContentIntegrate { Id = 0, Name = "Home", NavigatePath = "/", TitleHtml = "<i class=\"fas fa-home\"></i> Home", TitleLong = "Business Application Framework", TextMd = "# Web Application Framework\nWorkplaceX is an open source framework to simplify business application development. It provides the following features “out of the box”:\n\n![](assets/screen-cast.gif)\n\n* Data grids (high performance with millions of records and hundreds of columns)\n* Paging (horizontal and vertical), sorting, filtering\n* Lookup window and autocomplete function\n* Master detail relations\n* Modern looking browser web front end (desktop and mobile)\n* Menu Navigation\n* Data access to SQL server and/or memory\n* Multilanguage support\n* Configuration\n\nIt standardizes and simplifies the process of building enterprise business applications on top of existing SQL Server Databases. It can be hosted on premise or in the cloud and is based on the following products:\n\n* ASP.NET Core 5.0\n* Bootstrap 4 and/or Bulma\n* Angular 11 (Also server side rendering for high performance first page load)\n* SQL Server\n\nAllow thousands of users to access and manage your companies data in a controlled manner. Be flexible and evolve business models as the marked changes.\n\nDeliver complex web applications, without having to touch Html or JavaScript when adding new sql columns, tables or views. The framework fully supports continuous integration and delivery (CI/CD) and seamlessly integrates with\n\n* [Travis CI](https://travis-ci.org/)\n* [GitHub Actions](https://github.com/features/actions)\n* [Azure Pipelines](https://azure.microsoft.com/en-us/services/devops/pipelines/)\n\n# Live Example\nSee a live example: [https://demo.WorkplaceX.org](https://demo.workplacex.org)\n\n## GitHub\nOr download the source code from GitHub: **[ApplicationDemo](https://github.com/WorkplaceX/ApplicationDemo)** \n\nAdditionally, WorkplaceX business applications run also embedded in SharePoint or on any already existing company web page by just adding a few lines of html code.\n\n", TextHtml = "<h1>Web Application Framework</h1><p>WorkplaceX is an open source framework to simplify business application development. It provides the following features “out of the box”:</p><p></p><img src=\"assets/screen-cast.gif\" alt=\"assets/screen-cast.gif\" /><p></p><ul><li>Data grids (high performance with millions of records and hundreds of columns)</li><li>Paging (horizontal and vertical), sorting, filtering</li><li>Lookup window and autocomplete function</li><li>Master detail relations</li><li>Modern looking browser web front end (desktop and mobile)</li><li>Menu Navigation</li><li>Data access to SQL server and/or memory</li><li>Multilanguage support</li><li>Configuration</li></ul><p>It standardizes and simplifies the process of building enterprise business applications on top of existing SQL Server Databases. It can be hosted on premise or in the cloud and is based on the following products:</p><p></p><ul><li>ASP.NET Core 5.0</li><li>Bootstrap 4 and/or Bulma</li><li>Angular 11 (Also server side rendering for high performance first page load)</li><li>SQL Server</li></ul><p>Allow thousands of users to access and manage your companies data in a controlled manner. Be flexible and evolve business models as the marked changes.</p><p>Deliver complex web applications, without having to touch Html or JavaScript when adding new sql columns, tables or views. The framework fully supports continuous integration and delivery (CI/CD) and seamlessly integrates with</p><p></p><ul><li><a href=\"https://travis-ci.org/\">Travis CI</a></li><li><a href=\"https://github.com/features/actions\">GitHub Actions</a></li><li><a href=\"https://azure.microsoft.com/en-us/services/devops/pipelines/\">Azure Pipelines</a></li></ul><p></p><h1>Live Example</h1><p>See a live example: <a href=\"https://demo.workplacex.org\">https://demo.WorkplaceX.org</a></p><p></p><h2>GitHub</h2><p>Or download the source code from GitHub: <strong><a href=\"https://github.com/WorkplaceX/ApplicationDemo\">ApplicationDemo</a></strong> </p><p>Additionally, WorkplaceX business applications run also embedded in SharePoint or on any already existing company web page by just adding a few lines of html code.</p><p></p>", Sort = 1, IdName = "Home" },
                    new ContentIntegrate { Id = 0, Name = "IIS", NavigatePath = "/install/iis/", TitleHtml = null, TitleLong = null, TextMd = "# Local IIS Server\nWorkplaceX web application runs on local IIS server on Windows 10.\n\nIn order to run .NET applications on local IIS server install:\n\n* [.NET Hosting Bundle](https://dotnet.microsoft.com/download/dotnet) (ASP.NET Core Hosting Bundle)\n* [Node for IIS](https://github.com/Azure/iisnode/releases) (iisnode-full.msi)\n\nAfter successful installation Windows \"add remove programs\" should look like this:\n![](/assets/iis.png)", TextHtml = "<h1>Local IIS Server</h1><p>WorkplaceX web application runs on local IIS server on Windows 10.</p><p>In order to run .NET applications on local IIS server install:</p><p></p><ul><li><a href=\"https://dotnet.microsoft.com/download/dotnet\">.NET Hosting Bundle</a> (ASP.NET Core Hosting Bundle)</li><li><a href=\"https://github.com/Azure/iisnode/releases\">Node for IIS</a> (iisnode-full.msi)</li></ul><p>After successful installation Windows \"add remove programs\" should look like this:</p><img src=\"/assets/iis.png\" alt=\"/assets/iis.png\" />", Sort = null, IdName = "IIS" },
                    new ContentIntegrate { Id = 0, Name = "Install", NavigatePath = "/install/", TitleHtml = "<i class=\"fas fa-desktop\"></i> Install", TitleLong = "Install the Application Framework from Scratch", TextMd = "# Getting Started\nThe following two components need to be installed on the machine as prerequisite:\n* [Node.js](https://nodejs.org/en/) (LTS Version)\n* [.NET Core](https://dotnet.microsoft.com/download) (Version 5.0)\n* [SQL Server](https://www.microsoft.com/en-us/sql-server/sql-server-downloads) (Free Express Edition)\n\nWeb [Application Demo](https://github.com/WorkplaceX/ApplicationDemo) is a comprehensive example to get started with:\n\n## Install\n```cmd\n### Git clone (parameter recursive clones also required submodule Framework):\ngit clone https://github.com/WorkplaceX/ApplicationDemo.git --recursive\n\ncd ApplicationDemo\n\n### On first launch it will ask to register wpx command in environment path:\n./wpx.cmd # For Windows\n./wpx.sh # For Linux\n\n### From now on just use:\nwpx\n\n### Build\nwpx build # Builds client (Angular) and server (.NET)\n\n### Set ConnectionString\nwpx config connectionString=\"Data Source=localhost; Initial Catalog=ApplicationDemo; Integrated Security=True;\" # Example Windows\nwpx config connectionString=\"Data Source=localhost; Initial Catalog=ApplicationDemo; User Id=SA; Password=MyPassword;\" # Example Linux\n\n### Deploy Database\nwpx deployDb\n\n### Start\nwpx start # http://localhost:5000/\n\n### Stop\nkillall -g -SIGKILL -r Application.S # Example Linux. Close group (regular expression for Application.Server)\nsudo netstat -ltp # Show all program listening to port # Example Linux```\n\n## Command Line Interface (CLI)\nThe framework provides a command line interface (CLI) with all necessary functions like build, deploy and so on. In the root folder type cli.\n```cmd\ncd ApplicationDemo\nwpx\n```\nAll available framework CLI commands are listed like this:\n![](/assets/cli.png)", TextHtml = "<h1>Getting Started</h1><p>The following two components need to be installed on the machine as prerequisite:</p><ul><li><a href=\"https://nodejs.org/en/\">Node.js</a> (LTS Version)</li><li><a href=\"https://dotnet.microsoft.com/download\">.NET Core</a> (Version 5.0)</li><li><a href=\"https://www.microsoft.com/en-us/sql-server/sql-server-downloads\">SQL Server</a> (Free Express Edition)</li></ul><p>Web <a href=\"https://github.com/WorkplaceX/ApplicationDemo\">Application Demo</a> is a comprehensive example to get started with:</p><p></p><h2>Install</h2><p></p><pre><code class=\"language-cmd\">\n### Git clone (parameter recursive clones also required submodule Framework):\ngit clone https://github.com/WorkplaceX/ApplicationDemo.git --recursive\n\ncd ApplicationDemo\n\n### On first launch it will ask to register wpx command in environment path:\n./wpx.cmd # For Windows\n./wpx.sh # For Linux\n\n### From now on just use:\nwpx\n\n### Build\nwpx build # Builds client (Angular) and server (.NET)\n\n### Set ConnectionString\nwpx config connectionString=\"Data Source=localhost; Initial Catalog=ApplicationDemo; Integrated Security=True;\" # Example Windows\nwpx config connectionString=\"Data Source=localhost; Initial Catalog=ApplicationDemo; User Id=SA; Password=MyPassword;\" # Example Linux\n\n### Deploy Database\nwpx deployDb\n\n### Start\nwpx start # http://localhost:5000/\n\n### Stop\nkillall -g -SIGKILL -r Application.S # Example Linux. Close group (regular expression for Application.Server)\nsudo netstat -ltp # Show all program listening to port # Example Linux</code></pre><p></p><h2>Command Line Interface (CLI)</h2><p>The framework provides a command line interface (CLI) with all necessary functions like build, deploy and so on. In the root folder type cli.</p><pre><code class=\"language-cmd\">\ncd ApplicationDemo\nwpx\n</code></pre><p>All available framework CLI commands are listed like this:</p><img src=\"/assets/cli.png\" alt=\"/assets/cli.png\" />", Sort = 2, IdName = "Install" },
